var inputs = [
    initVariable('B1'),
    initVariable('B2')
];
var output = initVariable('M1');

function update() {
    var isOk          = false;
    var isUnreliable  = true;
    var isManuallySet = true;
    for (var i = 0; i < inputs.length; i++)
    {
        if (isVariableOn(inputs[i]))
        {
            isOk = true;
            if (!isVariableManuallySet(inputs[i])) {
                isManuallySet = false;
            }
            if (!isVariableUnreliable(inputs[i])) {
                isUnreliable = false;
            }
        }
    }
    if (isUnreliable) {
        isOk = false;
    }
    var fillColor = (isOk)
            ? (isManuallySet) ? '#ffeb3b' : '#4caf50'
            : '#f44336';
    setElementProperty('rect', 'fill', fillColor);
    setVariable(output, isOk);
    setVariableUnreliable(output, isUnreliable);
    setVariableManuallySet(output, isManuallySet);
}

return update;

var inputs = [
    initVariable('M1'),
    initVariable('B3'),
    initVariable('B4'),
    initVariable('B5'),
    initVariable('B6'),
    initVariable('B8')
];
var output = initVariable('M2');

function update() {
    var isOk          = true;
    var isUnreliable  = false;
    var isManuallySet = false;
    for (var i = 0; i < inputs.length; i++)
    {
        if (!isVariableOn(inputs[i]))
        {
            isOk = false;
        }
        if (isVariableManuallySet(inputs[i]))
        {
            isManuallySet = true;
        }
        if (isVariableUnreliable(inputs[i]))
        {
            isUnreliable = true;
        }
    }
    if (isUnreliable) {
        isOk = false;
    }
    var fillColor = (isOk)
            ? (isManuallySet) ? '#ffeb3b' : '#4caf50'
            : '#f44336';
    setElementProperty('rect', 'fill', fillColor);
    setVariable(output, isOk);
    setVariableUnreliable(output, isUnreliable);
    setVariableManuallySet(output, isManuallySet);
}

return update;

